import logo from './logo.svg';
import './App.css';
import { Link } from "react-router-dom";
import About from "./About/about.js";

function App() {
  return (
  <div>
  <Link to="/about">About</Link>
  <h2>Github Pages</h2>
  <h3>Deploying React to Github</h3>
  </div>
  );
 }
 export default App;
